INSERT INTO `front` (`subject`, `code`) VALUES
('EF509,EF521,EF524,CO224 will not be offered from 2024 onwards. !!!!', 'Alert_Course_Not_Offered'),
('1.  EF503: Critical Thinking and Writing Skills\n2.  EF505: Management in Practice with Case Studies\n3.  EF507: Government and Politics of Sri Lanka\n4.  EF508: Political Issues in Sri Lanka\n5.  EF510: Technology and Economic Development\n6.  EF512: Rural Economic Development and Technology\n7.  EF514: Cinema and Television\n8.  EF515: Theatre and Drama\n9.  EF517: Project in Fine Arts\n10. EF522: Sri Lankan Technology\n11. EF526: Marketing & Financial Management.\n12. CO224: Engineering Project\n\n', 'CoursesNotOffered'),
('The Engineering Education Unit was established in the Faculty of Engineering in 1985 primarily with the view to coordinating activities in the following areas: \n          1. Staff development \n          2. Curriculum development \n          3. Provision of audio-visual facilities for educational purposes \n          4. Freshmen orientation \nThe management and development of the EEU is the responsibility of a committee consisting of the Dean, the Director of the unit and members of the permanent academic staff appointed by the Faculty Board. The EEU has a professional audio-visual studio equipped with Non-Linear video editing and production system. EEU also has state of the art digital video and digital still cameras. Members of the teaching staff of the Faculty utilize these facilities to produce educational videos for use in their teaching and laboratory experiments. Three seminar rooms of capacities 105, 86 and 70 equipped with large screen multimedia projection facilities, digital whiteboards, interactive whiteboards, visual system presenters and overhead projectors are maintained by the EEU. In addition, the audio visual systems of the Faculty conference room and E.O.E. Pereira Theatre are maintained by the EEU. The conference room has a seating capacity of 28 and is equipped with a digital whiteboard and a video conferencing system. The E.O.E. Pereira Theatre has a seating capacity of 582 and is equipped with high power multimedia projectors and an extra large screen. The EEU has installed multimedia facilities to all lecture rooms and Drawing Office I of the Faculty. In addition, the EEU maintains and operates the public address system within the Faculty. From the year 2014, the EEU has been performing the overall coordination of the General Elective (GE) courses offered to 3rd and 4th year students of the Faculty. In the faculty, ', 'Home'),
('Refurbished by E73 Batch\r\n\r\nDigital White Board with Multimedia Projector and Document Scanner was donated by E97 batch in 2017', 'SeminarRoom1_Acknowledgement'),
('Fully air conditioned room\r\nCapacity - 105 seats\r\nLaptop\r\nDigital White Board with Multimedia Projector\r\nMotorized Wall Mounted Center Screen\r\nMultimedia Projector\r\nOverhead Projector, Screen with stand\r\nLaser Pointer\r\nWall Mounted Fans\r\nDocument Scanner for projection\r\nWhite Board\r\nPodium\r\nWired and wireless sound system', 'SeminarRoom1_facilities');

